function slCommonLibraries(warmupParamsEnv)
    % Check corresponding bit on the environment variable switch

%   Copyright 2023 The MathWorks, Inc.

    import simulink.online.internal.WarmupParamsEnum;
    warmupEnvValue = bitand(warmupParamsEnv, WarmupParamsEnum.SlCommonLibraries, 'uint32') > 0;
    if ~warmupEnvValue
        return;
    end

    preloadLibraries_L0();
    performance.cooperativeTaskManager.finishAllTasks;
end

